import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

function App() {
  const [casais, setCasais] = useState([]);
  const [telaAtual, setTelaAtual] = useState("menu"); // menu, cadastro, lista, aniversariantes
  const [form, setForm] = useState({
    nome_esposo: "",
    nome_esposa: "",
    aniversario_esposo: "",
    aniversario_esposa: "",
  });
  const [aniversariantes, setAniversariantes] = useState([]);

  useEffect(() => {
    carregarCasais();
  }, []);

  const carregarCasais = async () => {
    try {
      const response = await axios.get("http://localhost:8000/casais");
      setCasais(response.data);
      verificarAniversariantes(response.data);
    } catch (error) {
      console.error("Erro ao carregar casais:", error);
    }
  };

  const verificarAniversariantes = (lista) => {
    const hoje = new Date();
    const mes = hoje.getMonth() + 1;
    const dia = hoje.getDate();

    const encontrados = [];

    lista.forEach((casal) => {
      if (casal.aniversario_esposo) {
        const [ano, mesNasc, diaNasc] = casal.aniversario_esposo.split("-");
        if (parseInt(mesNasc) === mes && parseInt(diaNasc) === dia) {
          encontrados.push({
            id: casal.id + "-esposo",
            nome: casal.nome_esposo,
            aniversario: casal.aniversario_esposo,
          });
        }
      }
      if (casal.aniversario_esposa) {
        const [ano, mesNasc, diaNasc] = casal.aniversario_esposa.split("-");
        if (parseInt(mesNasc) === mes && parseInt(diaNasc) === dia) {
          encontrados.push({
            id: casal.id + "-esposa",
            nome: casal.nome_esposa,
            aniversario: casal.aniversario_esposa,
          });
        }
      }
    });

    setAniversariantes(encontrados);
  };

  const formatarData = (data) => {
    if (!data) return "";
    const [ano, mes, dia] = data.split("-");
    return `${dia}/${mes}`;
  };

  return (
    <div className="App">
      {telaAtual === "menu" && (
        <>
          <h1>üìñ Sistema ECC</h1>
          <button onClick={() => setTelaAtual("cadastro")}>
            ‚ûï Cadastrar Casal
          </button>
          <button onClick={() => setTelaAtual("lista")}>
            üìã Lista de Casais
          </button>
          <button onClick={() => setTelaAtual("aniversariantes")}>
            üéâ Aniversariantes
          </button>
        </>
      )}

      {telaAtual === "aniversariantes" && (
        <>
          <h2>üéâ PARAB√âNS! üéÇ</h2>
          {aniversariantes.length > 0 ? (
            aniversariantes.map((pessoa) => (
              <div key={pessoa.id} className="aniversariante-card">
                {/* üéà Bal√µes animados */}
                <div className="baloes-container">
                  {Array.from({ length: 15 }).map((_, i) => (
                    <div key={i} className="balao" style={{ "--i": i }}></div>
                  ))}
                </div>

                <p>
                  üéÇ <strong>{pessoa.nome}</strong> faz anivers√°rio hoje (
                  {formatarData(pessoa.aniversario)})!
                </p>
                <p className="versiculo">
                  üìñ "O amor √© paciente, o amor √© bondoso..." <br /> (1
                  Cor√≠ntios 13:4)
                </p>

                {/* bot√£o WhatsApp individual */}
                <button
                  className="btn-whatsapp-round"
                  onClick={() => {
                    const mensagem = `üéâ Parab√©ns ${
                      pessoa.nome
                    }! Hoje √© seu anivers√°rio (${formatarData(
                      pessoa.aniversario
                    )}) üéÇ\n\nüìñ O amor √© paciente, o amor √© bondoso... (1 Cor√≠ntios 13:4)`;

                    const url = `https://wa.me/?text=${encodeURIComponent(
                      mensagem
                    )}`;
                    window.open(url, "_blank");
                  }}
                >
                  <img
                    src="https://upload.wikimedia.org/wikipedia/commons/6/6b/WhatsApp.svg"
                    alt="WhatsApp"
                  />
                </button>
              </div>
            ))
          ) : (
            <p>Hoje n√£o h√° aniversariantes.</p>
          )}
          <button className="voltar-btn" onClick={() => setTelaAtual("menu")}>
            ‚¨ÖÔ∏è Voltar
          </button>
        </>
      )}
    </div>
  );
}

export default App;
